import { Navrouter } from "./Arreglos";

function Navxl() {
  return (


<nav className="h-10" >
        {Navrouter.map(([title]) => {
          <div className="flex h-12" >
            <a >
              {title}
            </a>
          </div>;
        })}
      </nav>


  );
}

